import React from "react";
import SectionLink from "./links/SectionLink";

import { fab } from "@fortawesome/free-brands-svg-icons";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";

const links = [
  {id: 1, name: 'Github', icon: 'fab fa-github fa-4x', link: 'https://github.com/abechoi'},
  {id: 1, name: 'Codepen', icon: 'fab fa-codepen fa-3x', link: 'https://github.com/abechoi'},
  {id: 1, name: 'LinkedIn', icon: 'fab fa-linkedin fa-4x', link: 'https://github.com/abechoi'},
];

const Navbar = () => {

  return (
    <nav className="navbar">
      <ul>
        <li><SectionLink name="Projects"/></li>
        <li><SectionLink name="Docs" /></li>
        <li><SectionLink name="Blogs" /></li>
        <li><SectionLink name="About" /></li>
      </ul>
      <ul>
        { links.map(link => {
          return (
            <li className="social-links">
              <a key={link.id} href={link.link} target="__blank">
                <FontAwesomeIcon icon={link.icon} />
              </a>
            </li>
          );
        })}
      </ul>
    </nav>
  );
}

export default Navbar;
